import { Component } from 'react';
import axios from 'axios';
import raw from '../Data/failas.txt';

export class ListOfListings extends Component {

    constructor(props){
        super(props);
        this.state = {
            listings: []
        }
    }

    componentDidMount()
    {

        var listings;
        fetch(raw)
            .then(r => r.text())
            .then(text => {
                listings = text;
                console.log('listings is ', listings);
            });
        
        this.setState({ listings });
        console.log(this.state.listings);

    }

    render()
    {
        return (

            <ul>
                {
                    this.state.listings
                        .map((listing, index) =>
                            <li key={index}>
                                { listing }
                            </li>
                        )
                }
            </ul>
        );
    }


}
